.
.
How we control the pressure within our abdominal walls, determines the function of the abdominal canisters. 
Without appropriate pressure management, you may increase the risk of DRA (often during pregnancy), potentially prolong a dysfunctional DRA postnatally, and increase the downward pressure on the pelvic floor musculature and pelvic organs
.
.
Although IAP is important it's not something to be feared!  We often hear "you shouldn't be lifting that", "avoid this activity as it increases IAP". But instead, what we should be educating is that sneezing and coughing often increase IAP ~MORE~ than lifting a 20kg weight (depending on the individuals strength), and that with appropriate IAP management, core synergy (breath!) and graded, progressive strength training, there are very few activities that need to be "avoided" - is any! 
.
.
