Why am I passionate?

There are too many reasons to share but the main ones are that women for too long have felt ashamed, embarrassed, guilty, uncertain and misinformed about their basic human right to have a safe, pleasurable, consensual sexual experience.

I was raised in a VERY conservative home where there was literally NO discussion or education about sex.

In school the tiny snippet of education I received was fear based and the main message for girls was DO NOT get pregnant and DO NOT get an STD.  That was it!! I remember feeling like it was all up to me to protect my body.  There was no education about pleasure OR a possibility that sex might be enjoyable!

So I guess it‚Äôs no surprise that I chose a profession where on a daily basis I get to bust myths, break old taboos and shake up the status quo!!

We all need to do better.

We all need to educate ourselves and our children in a better way.  Fear based sexual education and abstinence should not be the only options for our teens and young adults.

Happy World Sexual Health day!

What are some of the most crazy things you remember about your sexual health education?  What are still some of the misconceptions you may be holding on to?

