For those that have, most of their time is spent figuring out how to squeeze them and make them work correctly. 
 
Most of the time, relaxing or "letting go" of the pelvic floor muscles is overlooked and not emphasized.  Imagine what that does to these muscles overtime!  What if you were constantly squeezing your hand into a fist?  Overtime, would your hand get stiff, contracted, and not work as well?  Absolutely! 
 
The same concept applies to the pelvic floor. 
It's very important that these muscles relax while using the toilet and during penetration.  In fact, learning to relax or "let go" of the pelvic floor muscles can actually improve your "kegels" or squeezing of the pelvic floor muscles! 
 
